import datetime
from typing import List, Dict, Optional
from enum import Enum

# Enums for status and types
class PublishStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    PENDING = "pending"

class SubmissionType(Enum):
    FABS = "fabs"
    DABS = "dabs"

class UserRole(Enum):
    DEVELOPER = "developer"
    UI_DESIGNER = "ui_designer"
    AGENCY_USER = "agency_user"
    BROKER_USER = "broker_user"
    DATA_USER = "data_user"
    OWNER = "owner"
    TESTER = "tester"

# Models
class User:
    def __init__(self, user_id: str, role: UserRole, name: str):
        self.user_id = user_id
        self.role = role
        self.name = name

class Submission:
    def __init__(self, submission_id: str, submission_type: SubmissionType, user: User):
        self.submission_id = submission_id
        self.submission_type = submission_type
        self.user = user
        self.publish_status = PublishStatus.DRAFT
        self.created_at = datetime.datetime.now()
        self.updated_at = datetime.datetime.now()
        self.data = {}

    def update_publish_status(self, status: PublishStatus):
        self.publish_status = status
        self.updated_at = datetime.datetime.now()

class File:
    def __init__(self, file_id: str, name: str, extension: str, content: str):
        self.file_id = file_id
        self.name = name
        self.extension = extension
        self.content = content
        self.uploaded_at = datetime.datetime.now()

class ValidationRule:
    def __init__(self, rule_id: str, description: str, is_active: bool):
        self.rule_id = rule_id
        self.description = description
        self.is_active = is_active

class UIComponent:
    def __init__(self, component_id: str, name: str, current_design: str):
        self.component_id = component_id
        self.name = name
        self.current_design = current_design
        self.edits = []

    def add_edit(self, edit_note: str):
        self.edits.append((datetime.datetime.now(), edit_note))

# Services
class SubmissionService:
    def __init__(self):
        self.submissions: Dict[str, Submission] = {}

    def create_submission(self, submission_type: SubmissionType, user: User) -> Submission:
        submission_id = f"sub_{len(self.submissions) + 1}"
        submission = Submission(submission_id, submission_type, user)
        self.submissions[submission_id] = submission
        return submission

    def update_submission_status(self, submission_id: str, status: PublishStatus) -> bool:
        if submission_id not in self.submissions:
            return False
        self.submissions[submission_id].update_publish_status(status)
        return True

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        return self.submissions.get(submission_id)

class UIDesignService:
    def __init__(self):
        self.components: Dict[str, UIComponent] = {}

    def add_component(self, name: str) -> UIComponent:
        component_id = f"comp_{len(self.components) + 1}"
        component = UIComponent(component_id, name, "default_design")
        self.components[component_id] = component
        return component

    def update_component_design(self, component_id: str, new_design: str) -> bool:
        if component_id not in self.components:
            return False
        self.components[component_id].current_design = new_design
        return True

class ValidationService:
    def __init__(self):
        self.rules: Dict[str, ValidationRule] = {}

    def add_rule(self, description: str) -> ValidationRule:
        rule_id = f"rule_{len(self.rules) + 1}"
        rule = ValidationRule(rule_id, description, True)
        self.rules[rule_id] = rule
        return rule

    def toggle_rule(self, rule_id: str, is_active: bool) -> bool:
        if rule_id not in self.rules:
            return False
        self.rules[rule_id].is_active = is_active
        return True

class LoggingService:
    def __init__(self):
        self.logs = []

    def log(self, message: str, level: str = "INFO"):
        timestamp = datetime.datetime.now().isoformat()
        self.logs.append(f"{timestamp} - {level} - {message}")

    def get_logs(self) -> List[str]:
        return self.logs

# Main application
class BrokerApp:
    def __init__(self):
        self.submission_service = SubmissionService()
        self.ui_design_service = UIDesignService()
        self.validation_service = ValidationService()
        self.logging_service = LoggingService()

    def process_deletions(self, date: datetime.date):
        self.logging_service.log(f"Processing deletions for {date.isoformat()}")

    def notify_agencies(self, report: str):
        self.logging_service.log(f"Notifying agencies with report: {report}")

    def lock_site_during_gtas(self, start: datetime.datetime, end: datetime.datetime):
        self.logging_service.log(f"Site locked from {start} to {end} for GTAS")

# Example usage
if __name__ == "__main__":
    app = BrokerApp()

    # Create a user
    user = User("user1", UserRole.AGENCY_USER, "John Doe")

    # Create and publish a submission
    submission = app.submission_service.create_submission(SubmissionType.FABS, user)
    app.submission_service.update_submission_status(submission.submission_id, PublishStatus.PUBLISHED)

    # UI design process
    component = app.ui_design_service.add_component("Resources Page")
    app.ui_design_service.update_component_design(component.component_id, "new_broker_design")

    # Add validation rule
    rule = app.validation_service.add_rule("Check for required fields")
    app.validation_service.toggle_rule(rule.rule_id, False)

    # Process deletions
    app.process_deletions(datetime.date(2017, 12, 19))
